import React from 'react';
import { Link } from 'react-router-dom';

const CTABanner = () => {
  return (
    <section className="cta-banner">
      <div className="container">
        <h2>Book Today and Save 10%!</h2>
        <p>
          Don't wait - schedule your service today and take advantage of our limited-time offer. 
          Professional, reliable service at an unbeatable price.
        </p>
        <Link to="/pricing" className="btn btn-secondary btn-large">
          Get a Quote Now
        </Link>
      </div>
    </section>
  );
};

export default CTABanner;
